import {Container, Heading} from "@chakra-ui/react";

function UpcomingMatches(){
    return (
        <Container alignItems='center' bg='pink' mt='40px' minW='max-content' >
            <Heading bg='#030303' color='#7b7b7b' textAlign='center'>
                Upcoming Matches
            </Heading>
        </Container>
    )
}

export default UpcomingMatches;
